@param [String] key The lookup key
@param [Hash] values Will be merged with values of the current context
 and returned in a new context
@param [Callable] Block to execute in a new context
@yield [context, values] Yields the newly created context and values
  to the block

def.body:
@attributes = {} of String => AnyAttribute
attr.each do |k, v|
  @attributes[k] = AnyAttribute.new(k, v)
end

span = Span.new(span_name)
span.context = SpanContext.new(@span_context) do |ctx|
  ctx.span_id = @provider.id_generator.span_id
end
if @root_span.nil?
  @root_span = @current_span = span
else
  span.parent = @span_stack.last
  @span_stack.last.children << span
  @current_span = span
end
@span_stack << span
yield span
if @span_stack.last == span
  @span_stack.pop
  @current_span = @span_stack.last?
else
  raise("Unexpected Error: Invalid Spans in the Span Stack. Expected #{span.inspect} but found #{span_stack.last.inspect}")
end
